import { StatusBar } from 'expo-status-bar';
import React, { Component} from 'react';
import { StyleSheet, Text, View, Image, TouchableWithoutFeedback, keyboard, TouchableOpacity, KeyboardAvoidingView } from 'react-native';

export default function Login() {
  return (
    <View style={styles.container}>
      <Text>Welcome</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
